import React from "react";
import Card from "./Card";
import "./CardView.css";

function CardView(props) {
  const items = props.cards.find((item) => item.id === 3);
  const data = [];
  for (let i = 0; i < items.count; i++) {
    data.push({
      id: i + 1,
      volume: items.volume[i],
      Rupee: items.Rupee[i],
      Save: items.Save[i],
    });
  }
